import React from "react";
import './App.css';
import Navbar from "./components/Navbar";
import {BrowserRouter as Route, Router, Switch} from "react-router-dom";

function App() {
    return (
        <Router>
           <Navbar />
            <Switch>
                <Route path='/' />
            </Switch>
        </Router>
    );
}

export default App;
